import { Box, Grid, InputLabel, TextField, Button, Typography, Container } from '@material-ui/core';
import React, { Component } from 'react';
import { connect } from 'react-redux';
import mapStoreToProps from '../../redux/mapStoreToProps';

class Register extends Component {
  state = {
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    dob: '',
    address: '',
    occupation: '',
    typeOfHome: '',
    interestedIn: this.props.store.interestedReducer.id
  };
  registerUser = (event) => {
    event.preventDefault();
    this.props.dispatch({
      type: 'REGISTER',
      payload: {
        firstName: this.state.firstName,
        lastName: this.state.lastName,
        email: this.state.email,
        password: this.state.password,
        dob: this.state.dob,
        address: this.state.address,
        occupation: this.state.occupation,
        typeOfHome: this.state.typeOfHome,
      },
    });
  };
  handleInputChangeFor = (propertyName) => (event) => {
    this.setState({
      [propertyName]: event.target.value,
    });
  };

  render() {
    return (
      <Container>
        <Typography variant="h6">Register To Adopt {this.props.store.interestedReducer.name}</Typography>
          <InputLabel htmlFor="firstName">
            First Name:
            <TextField
              type="text"
              name="firstName"
              value={this.state.firstName}
              required
              onChange={this.handleInputChangeFor('firstName')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>
          <InputLabel htmlFor="email">
          Email:
            <TextField
              type="email"
              name="email"
              value={this.state.email}
              required
              onChange={this.handleInputChangeFor('email')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>
          <InputLabel htmlFor="lastName">
          Last Name:
            <TextField
              type="text"
              name="lastName"
              value={this.state.lastName}
              required
              onChange={this.handleInputChangeFor('lastName')}
            />
          </InputLabel>

          <Button variant="outlined" color="primary" onClick={this.registerUser}>Register</Button>
          </Container>
    );
  }
}

export default connect(mapStoreToProps)(Register);
